            if letter == 'A':
                return 'background-color: yellow'
            elif letter == '>':
                return '<br>'
            elif letter == 'C':
                return 'background-color: blue'
            elif letter == 'G':
                return 'background-color: red'
            elif letter == 'T':
                return 'background-color: orange'
            else:
                return ''
    
        
